Mis Años Invisible es un telegrama urgente a la conciencia de los líderes. Una luz roja que nos invita a pararnos, reflexionar y ajustar las prioridades de nuestra vida y ministerio. Es un dedo índice que señala a lo que de verdad importa. Escrito con dinamismo, pasión y filtrado por el tamiz de la experiencia, Benjamín Rivera nos envía una carta urgente cuya lectura no debe ser postergada. En definitiva, Benjamín no escribe lo que sabe, sino que pone en negro sobre blanco lo que vive. 
